import { Card, CardContent } from '@mui/material';
import React from 'react';
import Map from '../mappage/map.component';
import MapHeat from '../mappage/heatmap.component';
import {data} from '../../data/heatMapData'
import Chart from './chart.component';
import {ReactComponent as Legend} from "../../common/probability.svg"

import './homepage.styles.css';

const card = (
    <React.Fragment>
      <CardContent>
          Statistics
      </CardContent>
    </React.Fragment>
  );

const cardStyle = {
    margin: '0 50px 0 25px',
    width: '60%',
    height: '100%'
}

const chartStyle = {
    width: '1000px',
    height: '500px'
}

const HomePage = () => (
    <div className='homepage'>
        {/* <Map /> */}
        <div className="heatMap">
        <MapHeat data={data} center={{ lat: -25.274399, lng: 133.775131 }} />
        </div>
        <Legend/>
        <Card variant="outlined" style={cardStyle}>
            Fires
            <div style={chartStyle}>
                <Chart />
            </div>
        </Card>
    </div>
);

export default HomePage;
